export default (state = 'NULL', action) => {
  switch (action.type) {
    
    case 'INDEX_ITEMS':
      return action.payload.map(  (item) =>
        <div className='card' key={item.id}> 
          <div className='card-body'>

          </div>
          {item.id}
          {item.nome}
          {item.desc}
          {item.preco}
          <button>comprar</button>
        </div>
      );

    default:
      return state;
  }
}
